import React, { useEffect, useState } from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";
import { Link } from "react-router-dom";
import axios from "axios";

const Services = () => {
  const [message, setMessage] = useState("Hello world");
  const [services, setServices] = useState([
    {
      id: "4das354dasd",
      service: "Tailoring",
      price: 52.99,
      date: new Date(),
    },
    {
      id: "4das354dasd",
      service: "Tailoring",
      price: 52.99,
      date: new Date(),
    },
    {
      id: "4das354dasd",
      service: "Tailoring",
      price: 52.99,
      date: new Date(),
    },
  ]);
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    document.title = "Services - Khamco Shop";

    const fetchServices = async()
  }, []);
  return (
    <>
      <Navbar />
      <main className="p-[4rem]">
        <section className="py-0 px-[2rem] justify-center items-center grid-cols-1 gap-[1rem]">
          <h1 className="title">Services</h1>
          <div className="utilities">
            <Link to="/services/new">
              New Service <i className="fas fa-plus"></i>
            </Link>
            <p className="message">{message}</p>
          </div>
          <div className="utilities">
            <form action="/services" method="GET" className="search-engine">
              <input
                type="number"
                placeholder="Search service price"
                name="price"
                className="search-input"
              />
              <button type="submit" className="search-button">
                <i className="fas fa-search"></i>
              </button>
            </form>
            <form
              action="/services"
              method="GET"
              className="search-engine"
              id="date-form"
            >
              <input
                type="date"
                name="date"
                id="date-search"
                className="search-input"
              />
              <button type="submit" className="search-button">
                <i className="fas fa-check"></i>
              </button>
            </form>
          </div>
          {services.length > 0 ? (
            <table className="w-full my-[2rem] m-auto border-collapse text-[1.2rem] overflow-auto">
              <thead className="text-khamco-primary font-bold">
                <tr className="border-[0.2rem] border-khamco-secondary border-t-0 relative">
                  <td className="bg-[#ddd] text-center">Service</td>
                  <td className="bg-[#ddd] text-center">Price</td>
                  <td className="bg-[#ddd] text-center">Date</td>
                  <td className="bg-[#ddd] text-center"></td>
                </tr>
              </thead>
              <tbody>
                {services.map((service) => (
                  <tr className="border-[0.2rem] border-khamco-secondary border-t-0 relative">
                    <td className="text-center p-[0.5rem]">{service.service}</td>
                    <td className="text-center p-[0.5rem]">KWD {service.price}</td>
                    <td className="text-center p-[0.5rem]">
                      {service.date.toLocaleDateString("en-us", {
                        month: "long",
                        year: "numeric",
                        day: "numeric",
                      })}
                    </td>
                    <td className="text-center p-[0.5rem]">
                      <Link to={`/services/${service.id}`}>View</Link>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p className="empty">No services available.</p>
          )}
        </section>
      </main>
      <Footer />
    </>
  );
};

export default Services;
